import React, { Component } from 'react';
import SelectPoblacio from './Components/SelectPoblacio';
import SelectEspecialitats from "./Components/SelectEspecialitats";
import Cards from "./Components/Cards"
import { findRenderedDOMComponentWithClass } from 'react-dom/test-utils';




class App extends Component {
  render() {

    return (
      <div className="app conteiner">
        <div className="jumbotron">
          <h1 className="lead text-center">Benvinguts</h1>
        </div>
        <div className="container">
          <div className="row justify-content-md-center">
          <form >
            <div className="form-row " style={{}}>
              <div className="form-group col-md-3">
                <label>Nom restaurant</label>
                <input ref={this.nom} type="text" className="form-control" placeholder="" />
              </div>
              <SelectPoblacio />
              <SelectEspecialitats />
              <div className="form-inline">
                <input type="submit" className="btn btn-danger" value="Cercar"  onClick/>
              </div>

            </div>
          </form>
          </div>
        </div>
        <div className="container">
          <Cards />
        </div>
      </div>

    );
  }

}

export default App;
